import React from 'react';

import NavBar from './navbar/NavBar';
import Home from './home/Home';
import About from './about/About';
import Annonce from './Annonce';
import New from './nouvelles/New';
function App() {
  return (
    <div className="App">
      <NavBar />
      <Home />
      <About img='/image2.jpg' />
      <Annonce />
      <New/>
    </div>
  );
}

export default App;
